import Link from "next/link";
const Nav = () => {
    return (
        <nav style={{ backgroundColor:'gray' , padding:'20px 10px ' , transform:'none'}}>
            <Link href={'/'}><a>USERS </a></Link>
            <Link href={'/skills'}><a>SKILS</a></Link>
        </nav>
    )
}
export default Nav;
